import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./pages/LoginComponent";
import Footer from "./components/Footer";

function App() {
  return (
  <>
    <Router>
      <Routes>
        <Route path='/' element={<Login/>} exact/>
      </Routes>
    </Router>
    <Footer />
    </>
  );
};

export default App;
